import React from 'react';
import Buscar from '../UI/Buscar';
import Navegacion from './Navegacion';
import Boton from '../UI/Boton';
import styled from '@emotion/styled';
import {css} from '@emotion/core';
import Link from 'next/link';

const ContenedorHeader = styled.div`
    max-width: 1200px;
    width: 95%;
    margin: 0 auto;
    @media (min-width:768px){
        display: flex;
        justify-content: space-between;
    }
`;

const Logo = styled.p`
    color: var(--naranja);
    font-size: 4rem;
    line-height: 0;
    font-weight: 700;
    font-family: 'Roboto Slab', serif;
    margin-right: 2rem;
`;

const Header = () => {
    return ( 
        <header
            css={css`
                border-bottom: 2px solid var(--gris3);
                padding: 1rem 0;
            `}
        >
            <ContenedorHeader>
                <div>
                    <Link href="/">
                        <Logo>P</Logo>
                    </Link>


                    {/*Buscador Aqui*/}
                    <Buscar />

                    {/*Nav Aqui*/}
                    <Navegacion />

                </div>
                <div
                    css={css`
                        display: flex;
                        align-items: center;
                    `}
                >
                    {/*Menu de administracion*/}
                    <p
                        css={css`
                            margin-right: 2rem;
                        `}
                    >Hola: Gerardo</p>

                    <Boton
                        bgColor="true"
                    >Cerrar Sesi√≥n
                    </Boton>

                    <Link href="/">
                        <Boton
                            bgColor="true"
                        >Login</Boton>
                    </Link>
                    <Link href="/">
                        <Boton>Crear Cuenta</Boton>
                    </Link>
                </div> 
            </ContenedorHeader>
        </header>
     );
}

export default Header;
